import axios from 'axios';

export const getEnderecoPorCep = (cep) => {
    try {

      return axios.get(`https://viacep.com.br/ws/${cep}/json/`).then((res) => {

          return  {
            cep: res.data.cep
            , bairro: ''
            , cidade: ''
          }
       });

    } catch (error) {
      console.error(error);
    }
  }
